import React from "react";
import * as Globals from "../../Helpers/Global/Global"

const AccordionTab =(props)=>{
    let accordionHeading = null;
  //  accordionHeading = Globals.isH2orH3("h3","Accordion tabs Heading", "")
   return(
    <div>
        <button id="" className="accordion-header ui-accordion-header ui-helper-reset ui-state-default bg-white bg-right-arrow-white" data-no-tag="1" aria-expanded="false" aria-controls="@divID" role="button">
            <span className="c-paragraph-3 x-hidden-focus">{props.accordionTabHeading}</span>
        </button>

        <div className="accordionpanel  ui-accordion-content ui-helper-reset ui-widget-content ui-corner-bottom" id="">
            <div className="left-content">
                <p>{props.accordionContent}</p>
            </div>
        </div>
    </div>
   ) 
}
export default AccordionTab;
